public class VerifiedAccessTrustProviderFactory(string resourceName = null, Action<Humidifier.EC2.VerifiedAccessTrustProvider> factoryAction = null) : ResourceFactory<Humidifier.EC2.VerifiedAccessTrustProvider>(resourceName)
{

    internal InnerVerifiedAccessTrustProviderDeviceOptionsFactory DeviceOptionsFactory { get; set; }

    internal InnerVerifiedAccessTrustProviderOidcOptionsFactory OidcOptionsFactory { get; set; }

    internal InnerVerifiedAccessTrustProviderSseSpecificationFactory SseSpecificationFactory { get; set; }

    protected override Humidifier.EC2.VerifiedAccessTrustProvider Create()
    {
        var verifiedAccessTrustProviderResult = CreateVerifiedAccessTrustProvider();
        factoryAction?.Invoke(verifiedAccessTrustProviderResult);

        return verifiedAccessTrustProviderResult;
    }

    private Humidifier.EC2.VerifiedAccessTrustProvider CreateVerifiedAccessTrustProvider()
    {
        var verifiedAccessTrustProviderResult = new Humidifier.EC2.VerifiedAccessTrustProvider
        {
            GivenName = InputResourceName,
        };

        return verifiedAccessTrustProviderResult;
    }
    public override void CreateChildren(Humidifier.EC2.VerifiedAccessTrustProvider result)
    {
        base.CreateChildren(result);

        result.DeviceOptions ??= DeviceOptionsFactory?.Build();
        result.OidcOptions ??= OidcOptionsFactory?.Build();
        result.SseSpecification ??= SseSpecificationFactory?.Build();
    }

} // End Of Class

